import React from "react";
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';
import { spacing } from '@material-ui/system';


const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing.unit * 2,
    margin: 5,
    maxWidth: '100%',
  },
  image: {
    width: 128,
    height: 128,
  },
  img: {
    margin: 'auto',
    display: 'block',
    maxWidth: '100%',
    maxHeight: '100%',
  },
});

class HeaderContent extends React.Component{
    render(){
        const { classes, theme } = this.props;

  return (
<div className={classes.root}>
<Paper className={classes.paper}>
  <Grid container spacing={16}>
    <Grid item>
      <ButtonBase className={classes.image}>
        <img className={classes.img} alt="complex" src="https://hacktiv8.com/img/fox.png__vzu2vhp2VRX%2Bewg7J0bPlaAa9e377ae39495073d0e66db163fc8d9b" />
      </ButtonBase>
    </Grid>
    <Grid item xs={12} sm container>
      <Grid item xs container direction="column" spacing={16}>
        <Grid item xs>
          <Typography gutterBottom component="h6" variant="h6">
            Hacktive8 Meetup
          </Typography>
          <Typography gutterBottom color="textSecondary">
          Location Jakarta Indonesia
          </Typography>
        <Typography gutterBottom color="textSecondary">
          Members 1,078
        </Typography>
        <Typography gutterBottom color="textSecondary">
          Organizers Ardhy Wiranata
        </Typography>

        <div style={{ display: "flex", alignItems: 'flex-end' }}>
        <Typography color="textSecondary" mr={50} >
          Project:     
        </Typography>
        <Typography color="textSecondary" >
          Example
        </Typography>
      </div>
      <Grid item xs={3}>
          <Paper className={classes.paper}>xs=3</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper className={classes.paper}>xs=3</Paper>
        </Grid>

        </Grid>
        <Grid item>
          <Typography style={{ cursor: 'pointer' }}>Remove</Typography>
        </Grid>
      </Grid>
      <Grid item>
      <Typography style={{ cursor: 'pointer' }}>See all</Typography>
      </Grid>
    </Grid>
  </Grid>
</Paper>
</div>
    );
    }
}

export default withStyles(styles, { withTheme: true })(HeaderContent);
